const rewire = require("rewire")
const root = rewire("./root")
const _interopRequireDefault = root.__get__("_interopRequireDefault")
const _possibleConstructorReturn = root.__get__("_possibleConstructorReturn")
const _inherits = root.__get__("_inherits")
// @ponicode
describe("_interopRequireDefault", () => {
    test("0", () => {
        let callFunction = () => {
            _interopRequireDefault({ __esModule: "Dillenberg" })
        }
    
        expect(callFunction).not.toThrow()
    })

    test("1", () => {
        let callFunction = () => {
            _interopRequireDefault({ __esModule: "Elio" })
        }
    
        expect(callFunction).not.toThrow()
    })

    test("2", () => {
        let callFunction = () => {
            _interopRequireDefault({ __esModule: "elio@example.com" })
        }
    
        expect(callFunction).not.toThrow()
    })

    test("3", () => {
        let callFunction = () => {
            _interopRequireDefault(undefined)
        }
    
        expect(callFunction).not.toThrow()
    })
})

// @ponicode
describe("_possibleConstructorReturn", () => {
    test("0", () => {
        let callFunction = () => {
            _possibleConstructorReturn(true, "callback detected, not supported yet")
        }
    
        expect(callFunction).not.toThrow()
    })

    test("1", () => {
        let callFunction = () => {
            _possibleConstructorReturn(0, { This: "is", an: "object", Do: 0, you: 1, Like: 2, it: 10000 })
        }
    
        expect(callFunction).not.toThrow()
    })

    test("2", () => {
        let callFunction = () => {
            _possibleConstructorReturn(false, "callback detected, not supported yet")
        }
    
        expect(callFunction).not.toThrow()
    })

    test("3", () => {
        let callFunction = () => {
            _possibleConstructorReturn(true, { This: "is", an: "object", Do: 0, you: 1, Like: 2, it: 10000 })
        }
    
        expect(callFunction).not.toThrow()
    })

    test("4", () => {
        let callFunction = () => {
            _possibleConstructorReturn(0, "callback detected, not supported yet")
        }
    
        expect(callFunction).not.toThrow()
    })

    test("5", () => {
        let callFunction = () => {
            _possibleConstructorReturn(undefined, undefined)
        }
    
        expect(callFunction).not.toThrow()
    })
})

// @ponicode
describe("_inherits", () => {
    test("0", () => {
        let callFunction = () => {
            _inherits({ __proto__: "a85a8e6b-348b-4011-a1ec-1e78e9620782" }, "elio@example.com")
        }
    
        expect(callFunction).not.toThrow()
    })

    test("1", () => {
        let callFunction = () => {
            _inherits({ __proto__: "03ea49f8-1d96-4cd0-b279-0684e3eec3a9" }, "callback detected, not supported yet")
        }
    
        expect(callFunction).not.toThrow()
    })

    test("2", () => {
        let callFunction = () => {
            _inherits({ __proto__: "a85a8e6b-348b-4011-a1ec-1e78e9620782" }, "Dillenberg")
        }
    
        expect(callFunction).not.toThrow()
    })

    test("3", () => {
        let callFunction = () => {
            _inherits({ __proto__: "03ea49f8-1d96-4cd0-b279-0684e3eec3a9" }, "Dillenberg")
        }
    
        expect(callFunction).not.toThrow()
    })

    test("4", () => {
        let callFunction = () => {
            _inherits({ __proto__: "a85a8e6b-348b-4011-a1ec-1e78e9620782" }, "callback detected, not supported yet")
        }
    
        expect(callFunction).not.toThrow()
    })

    test("5", () => {
        let callFunction = () => {
            _inherits(undefined, undefined)
        }
    
        expect(callFunction).not.toThrow()
    })
})
